import React from 'react';
import logo from '../img/lo.png'
// import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
// import { faFacebook,faInstagram,faYoutube } from '@fortawesome/free-brands-svg-icons';
// import { faPhoneAlt, faArrowCircleDown} from '@fortawesome/free-solid-svg-icons'
import { Navbar, Nav, } from 'react-bootstrap';
const Navigation = () => {
  return (
    <div className="navbar_body">
      <Navbar collapseOnSelect expand="lg" bg="" variant="dark">
        <Navbar.Brand href="#home"><img src={logo} className="logo container" alt="logo" /></Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="ml-auto menuitem">
            <Nav.Link href="#home" id ="home">Home</Nav.Link>
            <Nav.Link href="#service" id ="home" >Service</Nav.Link>
            <Nav.Link href="skill" id ="home" >Skill</Nav.Link>
            <Nav.Link href="about" id ="home" >About Me</Nav.Link>
            <Nav.Link href="contact" id ="home" >Contact</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Navbar>

      {/* Bodytext */}
      <div className="container">
        <div className="row">
          <div className="col-md-6">
            <div className="nametext">
            <h1> Hello I`m </h1>
            <h1>Rabin Subedi</h1>
            <p> Web Designer</p>
            <button className="btn btn-success">Hire Me</button>
            </div>
          </div>
        </div>
      </div>

    </div>
  )
}
export default Navigation;
